import React, { Component } from "react";

class Content extends Component {
    constructor(props){
        super(props);
        this.state = {
            subject: {title}
        }
    }

    render() {
        return (
            <nav>
                <ul>
                    <li><a href="#">HTML</a></li>
                    <li><a href="#">CSS</a></li>
                    <li><a href="#">JavaScript</a></li>
                </ul>
            </nav>
        )
    }
}

export default Content;
